# Problem: wrtie a program that takes an array A and an index i into A, and rearranges the elements 
#          such that all elements less than A[i] (the "pivot") appear first, followed by elements
#          equal to the pivot, followed by elements greater than the pivot

def dutch_flag_partition(pivot_index, A):
    next_smaller, next_equal, next_greater = 0, 0, len(A) - 1
    element = A[pivot_index]
    while next_equal <= next_greater:
        if A[next_equal] == element:
            next_equal += 1
        elif A[next_equal] < element:
            A[next_smaller], A[next_equal] = A[next_equal], A[next_smaller]
            next_smaller += 1
            next_equal += 1
        else:
            A[next_greater], A[next_equal] = A[next_equal], A[next_greater]
            next_greater -= 1
    return A

